import React from 'react'
import { Jumbotron, Container} from 'reactstrap';
import Image from 'react-bootstrap/Image'

const h3 = {
	color:"white",
	position:"absolute",
	top:"50%",
	left:"50%",
	transform: "translate( -50%, -50% )",
	textAlign:"center",
}

const jumbo = {
	padding:"0",
}

const Jumbo = (props) => {
	return (
		<div>
		<Jumbotron fluid style={jumbo} >
		<Image src="img/jumbotron_background.jpg" fluid/>
			<Container >
				<h3 style={h3}>점보트론</h3>
			</Container>
		</Jumbotron>
		</div>
	);
};

export default Jumbo;
